import { Link } from "react-router-dom";
import styles from "./Card.module.css";

export default function Dog({
  name,
  height,
  weight,
  years,
  image,
  temperament,
  id,
}) {
  return (
    <div className={styles.card}>
      <img src={image} alt="img" className={styles.image} />
      <Link to={`/home/${id}`} className={styles.name}>
        <div>{name}</div>
      </Link>

      <div>Weight: {weight}</div>

      <p className={styles.temp}>
        Temperaments:{" "}
        {Array.isArray(temperament)
          ? temperament.map((temp) => temp.name).join(", ")
          : temperament}
        .
      </p>
      <br />
      <div>{height ? `Height:  ${height} ${(<br />)}` : ""}</div>
      <div>{years ? `Life Span: ${years} ${(<br />)}` : ""}</div>
      <br />
    </div>
  );
}
